

class Solution(object):
	def findMaxLength(self, nums):
		"""
		给定一个二进制数组, 找到含有相同数量的 0 和 1 的最长连续子数组。
		---
		输入: [0,1]
		输出: 2
		说明: [0, 1] 是具有相同数量0和1的最长连续子数组。
		---
		输入: [0,1,0]
		输出: 2
		说明: [0, 1] (或 [1, 0]) 是具有相同数量0和1的最长连续子数组。
		---
		注意: 给定的二进制数组的长度不会超过50000。
		---
		思路:
		动态规划+哈希表
		:type nums: List[int]
		:rtype: int
		"""
		if not nums:
			return 0
		n = len(nums)
		res = [[0,0] for _ in range(n)]
		# print(res)
		for i in range(n):
			if i >0:
				if nums[i] == 0:
					res[i][0] = res[i-1][0]+1
					res[i][1] = res[i-1][1]
				else:
					# print(i)
					res[i][0] = res[i-1][0]
					res[i][1] = res[i-1][1]+1
			else:
				res[i][nums[i]] += 1
		print(res)
		max_len = 0
		for i in range(n-1,-1,-1):
			for j in range(i):
				# print(i,j)
				if res[i][0] == res[i][1] and i+1 > max_len:
					max_len = i+1
				elif res[i][0] - res[j][0] == res[i][1]-res[j][1] and i-j > max_len:
					max_len = i-j
		return max_len
